import React from "react";
import { Link } from "react-router-dom";
import mechagodzillaList from "../../lists/mechagodzillaList";

const MechagodzillaListDisplay = () => {
  const mechagodzillaListMap = mechagodzillaList.map((mechagodzilla) => {
    return (
      <li>
        <Link to={mechagodzilla.link}>{mechagodzilla.name}</Link>
      </li>
    );
  });

  return (
    <>
      <h2>Mechagodzilla</h2>
      <ul>{mechagodzillaListMap}</ul>
    </>
  );
};

export default MechagodzillaListDisplay;
